import React from 'react'
import TileGrid from 'components/tiles.d/tile-grid.component'
import {Entity} from 'components/country-search.d/country-search.component'
import "./country-results.css";

interface Props {
	search?:Entity[]
}
interface State {
	status:"waiting"|"loading"|"finished"
}

export default class CountryResults extends React.Component<Props,State> {


	constructor(props:Props){
		super(props);
		this.setState({status:"waiting"})
	}


	render(){
		switch(this.state.status){
		case 'waiting':
			return;
		case 'loading':
			return (<div className='loading'></div>)
		case 'finished':
			return (
				<div id="output">
					{(!this.state.search||!this.state.search.length)
						? <div className='emptyResults'>No results</div>
						: <TileGrid content={this.state.search}/>
					}
				</div>
			)
		}		
	}
}
